import Addingprevious from './Addingprevious';
const Addnotes=()=>{
    let [note,setNote]=useState
    return (
        <>
        <div className='writeNote'> 
        <textarea className='enterText' placeholder='Write Text here' />
        <button className='plusSign'>+</button>
        </div>
        <div className='Tnotes'>
        <Addingprevious text="you know me"/>
        </div>
        </>
    )
}
export default Addnotes;
